import {Injectable} from '@angular/core';
import {Http, Headers} from '@angular/http';

@Injectable()
export class GoogleService {

    // private postUrl: string = 'http://192.168.11.2:8080/s';
    // private postUrl: string = 'http://203.124.13.128:3811';
    private postUrl: string = 'http://203.124.13.128:7388';

    constructor(private http:Http) {
    }

    getImageSearchList(imageData:string) {
        let headers = new Headers();
        headers.append('Content-Type','application/json');
        let resultList = this.http.post(this.postUrl + "/g/image", '{img: "' + imageData + '",fileName:"1.jpg"}', { headers: headers });
        return resultList;
    }

    getServerImageUrl(path: string){
        return this.postUrl+'/func/api/imagelib/file?path=' + path + '&fileName=&category=image_search';
    }

    getBase64(path: string){
        let resultList = this.http.get(this.postUrl + '/g/base64?path=' + path +'&category=image_search');
        return resultList;
    }

    public testImg: string = '';
}